/* index.js in reducers folder Nov 8,2018*/

function reducer (state, action) {
	switch (action.type) {
		case "is_open":
			return;  //return new state
		case "is_clicked":
			return; //return new state
		default:
		return state;
	}
}
export default (state, action) => {
  console.log(action);
  return state;
}; //This is after Actions Dispatched

